import React from 'react';

type UserProps = {
    userInfo: {
        firstName: string
        lastName: string
    }

}

const Person = ({ userInfo }: UserProps) => {
    return (
        <div>
            <h3>I am the Person</h3>
            <div>
                <p>First Name: { userInfo.firstName }</p>
                <p>Last Name: { userInfo.lastName }</p>
            </div>
        </div>
    );
};

export default Person;
